func TestS3_UploadObject(t *testing.T) {
	storage := GetS3Storage()

	objectKey := "xxx/mr-big.jpg"
	localFile := "/Users/a/Pictures/mr-big.jpg"

	err := storage.UploadObject(objectKey, localFile, true)
	if err != nil {
		t.Errorf("err:%v", err)
		return
	}

	t.Logf("ok")
}

func TestS3Storage_UploadByContent(t *testing.T) {
	storage := GetS3Storage()

	objectKey := "xxx/scenery-01.jpg"
	content := "data:image/jpg;base64,"

	_, data, perr := utils.ParseBase64Img(content)
	if perr != nil {
		t.Errorf("ParseBase64Img-err:%v", perr)
		return
	}

	err := storage.UploadByContent(objectKey, data, true)
	if err != nil {
		t.Errorf("err:%v", err)
		return
	}

	t.Logf("ok")
}

func TestS3Storage_GetObject(t *testing.T) {
	storage := GetS3Storage()

	objectKey := "xxx/mr-big.jpg"

	content, err := storage.GetObject(objectKey)
	if err != nil {
		t.Errorf("GetFile-err:%v", err)
		return
	}

	localFile := "/Users/a/Pictures/mr-big_xxx.jpg"

	if err := ioutil.WriteFile(localFile, content, 0777); err != nil {
		t.Errorf("WriteFile-err:%v", err)
		return
	}

	t.Logf("ok")
}

